// Description.js
import React from 'react';
import videoBg from "./components/sky.mp4";
import mySvg from './components/Description.svg';
import './styling/Description.css'; // Import CSS file for styling

const Description = () => {
  return (
    <div style={{ position: 'relative', width: '100vw', height: '100vh', overflow: 'hidden' }}>
      {/* Video */}
      <video autoPlay loop muted playsInline style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', objectFit: 'cover', opacity:'0.8' }} playbackRate={0.25} >
        <source src={videoBg} type="video/mp4"></source>
      </video>

      {/* SVG */}
      <div style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}>
        <img src={mySvg} alt="Experiment Description" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />

        {/* Next button links */}
        <button className="next-button" onClick={() => window.location.href = "/description"}>Next</button>

        {/* Participant ID */}
        <button className="user-id">id</button>

        {/* VibeVision text */}
        <div className="vibe-vision">VibeVision</div>

        {/* Input Box */}
        <div className="input-box">
          <input type="text" placeholder="Enter text..." />
        </div>
      </div>
    </div>
  );
};

export default Description;
